    return (
        <ProductConsumer>
            {value =>{
                const {links, sidebarOpen, handleSidebar} = value;
                return <SideWrapper>
                    <ul>
                        <li>home</li>
                    </ul>
                
                </SideWrapper>

                }
            }
            
        </ProductConsumer>
    )
}

const SideWrapper = styled.nav`


`;
